const Navbar = () => {
  return (
    <nav
      id="navbar"
      className="min-w-full bg-gray-900 text-orange-50 min-h-[6rem] items-center flex justify-end"
    >
      <ul className="flex flex-row gap-[3rem] text-xl me-10 ">
        <li className="hover:cursor-pointer rounded-md bg-white">
          Leaderboard
        </li>
        <li className="hover:cursor-pointer">IDK THA</li>
        <li className="hover:cursor-pointer">WHATEVER</li>
      </ul>
    </nav>
  );
};

export default Navbar;
